Mongoose or MongoDB removing 24 hours from date?<p>I have to be doing something wrong but I cannot figure out what it is.  I currently have a date field in my application that has a value format of MMMM, D YYYY.</p>

<p>For this example, I am going to be using the date October 1, 2018.</p>

<p>In the application, the user selects October 1, 2018 which logs as</p>

<p><code>October 1, 2018</code></p>

<p>Later I convert this date into a savable date by using <code>var docDate = new Date($('#insuranceExpiration').val()).toISOString();</code> which logs as </p>

<p><code>2018-10-01T04:00:00.000Z</code></p>

<p>I then add this to an object stringify it and send it to the server where I log the date and shows as</p>

<p><code>2018-10-01T04:00:00.000Z</code></p>

<p>I then use Mongoose to save this date to MongoDB but when I go to see the saved date I show </p>

<p><code>2018-09-30T04:00:00.000Z</code></p>

<p>I cannot figure out for the life of me why I am seeing a date 24 hours in the past from the date I choose.  Below is the mongoose code to see if I am doing something wrong on that end.</p>

<pre><code>app.post('/api/myDocuments/insuranceGeneral', function(req, res ) {

    console.log(req.body.expires);
    // prints 2018-10-01T04:00:00.000Z

    InsuranceGeneral.findOneAndUpdate({
        _id: req.rsaConPortal.id
    }, {
        $set: {
            "documents.insurance.name": req.body.name,
            "documents.insurance.expires": req.body.expires,
            "documents.insurance.url": req.body.url,
            "documents.insurance.uploadDate": req.body.uploadDate
        }
    }, function(err, doc) {

       if (err) throw err;

        res.send('Success');

    });

});
</code></pre>

<p>Even if I use a standard javascript date object I can print this on the browswer log</p>

<p><code>Mon Oct 01 2018 00:00:00 GMT-0400 (Eastern Daylight Time)</code></p>

<p>This prints on the sever just before mongoose</p>

<p><code>2018-10-01T04:00:00.000Z</code></p>

<p>But this is the end result in mongodb</p>

<p><code>2018-09-30T04:00:00.000Z</code></p>

