How to return the result of multiple async/await calls in node.js and mongoose<p>So I have a function that makes a series of async calls to a MongoDB database. I want to return the result when all of the calls are done however the following code isn't doing that. </p>

<pre><code>const getMatchesInfo = async mongoDBUserIds =&gt; {
    _.map(mongoDBUserIds, async mongoDBUserId =&gt; {
        const user = await UserCollection.findOne({
            _id: mongoDBUserId
        });
        console.log('user.profile.name = ', user.profile.name);

        return user;
    });
};
</code></pre>

<p>I call this function in my Node.js API with:</p>

<pre><code>module.exports = app =&gt; {
    app.get('/api/matches', requireLogin, async (request, response) =&gt; {
        const mongoDBUserIds = request.query.mongoDBUserIds.split(',');
        let matches_info = await getMatchesInfo(mongoDBUserIds); // &lt;=== await here

        console.log('matches_info = ', matches_info);
        response.send(matches_info);
    });
};
</code></pre>

<p>What I don't understand is why is matches_info getting printed out before the console.logs inside function <code>getMatchesInfo</code>? I thought the <code>await here</code> was suppose to prevent code below it from running until <code>getMatchesInfo</code> returned. What am I not understanding?</p>

